    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box
    }

    body {
      font-family: Arial, sans-serif;
      background-color: #f5f5f5;
      color: #333
    }

    .container {
      margin: 0 auto;
      max-width: 1800px;
      padding: 0 10vw
    }

    .main {
      margin: 80px 0
    }

    .header {
      background: linear-gradient(135deg, #1a1a1a, #2c2c2c);
      border-bottom: 3px solid red;
      box-shadow: 0 2px 20px red;
      text-align: center;
      color: #fff;
      position: fixed;
      top: 0;
      z-index: 10;
      width: 100vw;
      height: 80px
    }

    .header .container {
      display: flex;
      justify-content: space-between
    }

    .header .container .logo-container {
      padding: 1rem
    }

    .header .container .logo-container img {
      width: 160px;
      height: auto
    }

    .header .container nav {
      display: flex;
      gap: 5px
    }

    .btn-header {
      background: transparent;
      border-radius: 0;
      margin: auto 0;
      height: 70%;
      transition: ease .25s;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 1rem;
      background-image: linear-gradient(curre)
    }

    .btn-header h2 {
      font-size: 1rem;
      font-family: Orbitron, sans-serif
    }

    .btn-header:hover h2:before {
      content: "";
      position: absolute;
      display: block;
      width: 100%;
      height: 2px;
      bottom: 0;
      left: 0;
      background-color: #000;
      transform: scaleX(0);
      transition: transform .3s ease
    }

    .footer {
      width: 100vw;
      height: 80px;
      background: #1a1a1a;
      color: #fff;
      text-align: center;
      border-top: 2px solid red;
      z-index: 100;
      display: flex;
      align-items: center;
      justify-content: center
    }

    .hero-block {
      width: 100%;
      height: 100vh;
      position: relative;
      height: fit-content;
      overflow: hidden
    }

    .hero-block .img-hero-block {
      width: 100%;
      height: 100%
    }

    .hero-block .img-hero-block img {
      width: 100%;
      display: block;
      overflow: hidden
    }

    .hero-block .dark-hero-block {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: #000;
      opacity: .5
    }

    .hero-block .hero-container-text {
      width: 50%;
      position: absolute;
      top: 30%;
      left: 0%;
      color: #fff;
      text-align: left
    }

    .hero-block .hero-container-text .main-hero-block {
      font-size: 4rem
    }

    .hero-block .hero-container-text .secondary-hero-block {
      font-size: 1.7rem
    }

    .services-card {
      display: grid;
      grid-template-columns: auto auto;
      grid-template-rows: auto auto;
      grid-row-gap: 1vw;
      grid-column-gap: 1vw
    }

    @keyframes gradientWave {

      0%,
      to {
        height: 60px;
        opacity: .7
      }

      50% {
        height: 80px;
        opacity: 1
      }
    }

    .page-gradient {
      position: absolute;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 60px;
      background: linear-gradient(to bottom, transparent, rgba(255, 255, 255, .1) 20%, white 100%);
      animation: gradientWave 3s ease-in-out infinite
    }

    .service-card {
      gap: 20px;
      width: fit-content;
      border-radius: 20px;
      border: 3px solid red;
      padding: 20px;
      display: flex;
      flex-direction: column;
      box-shadow: 0 3px 10px red
    }

    .service-card img {
      height: auto;
      border-radius: 8px;
      overflow: hidden;
      width: 100%
    }

    .service-card p {
      font-size: 2rem;
      cursor: pointer
    }

    .services-section {
      margin-top: 50px
    }

    .about-page {
      width: 100dvw;
      min-height: 100dvh
    }

    .about {
      margin-top: 150px;
      margin-bottom: 150px;
      display: flex;
      flex-direction: column;
      gap: 20px
    }

    .services-section {
      margin-top: 150px;
      margin-bottom: 150px
    }

    .vacancies-page {
      width: 100dvw;
      min-height: 100dvh
    }

    :root {
      font-family: system-ui, Avenir, Helvetica, Arial, sans-serif;
      line-height: 1.5;
      font-weight: 400;
      color-scheme: light dark;
      color: #ffffffde;
      background-color: #242424;
      font-synthesis: none;
      text-rendering: optimizeLegibility;
      -webkit-font-smoothing: antialiased;
      -moz-osx-font-smoothing: grayscale
    }

    a {
      font-weight: 500;
      color: #646cff;
      text-decoration: inherit
    }

    a:hover {
      color: #535bf2
    }

    body {
      margin: 0;
      display: flex;
      justify-content: center;
      min-width: 320px;
      min-height: 100vh
    }

    h1 {
      font-size: 3.2em;
      line-height: 1.1
    }

    button {
      border-radius: 8px;
      border: 1px solid transparent;
      padding: .6em 1.2em;
      font-size: 1em;
      font-weight: 500;
      font-family: inherit;
      background-color: #1a1a1a;
      cursor: pointer;
      transition: border-color .25s
    }

    @media (prefers-color-scheme: light) {
      :root {
        color: #213547;
        background-color: #fff
      }

      a:hover {
        color: #747bff
      }

      button {
        background-color: #f9f9f9
      }
    }
  </style>
